import "./ExpenseItem.css";
function ExpenseItem() {
    return (
        <div>
            <div className="date">21/12/2021</div>
            <div className="title">
                <h2>Car Insurance</h2>
            </div>
            <div className="amount">$250.00</div>
        </div>
    );
}
export default ExpenseItem;
